REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'ar', 'ساعد زملائك المسافرين بينما تحصل على العملة التي تحتاجها. بناء اتصالات مع الناس في حيك.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'de', 'Helfen Sie anderen Reisenden, während Sie die benötigte Währung erhalten. Bauen Sie Verbindungen zu Menschen in Ihrer Nachbarschaft auf.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'en', 'Help fellow travelers while getting the currency you need. Build connections with people in your neighborhood.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'es', 'Ayuda a otros viajeros mientras obtienes la moneda que necesitas. Construye conexiones con personas en tu barrio.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'fr', 'Aidez vos compagnons de voyage tout en obtenant la devise dont vous avez besoin. Construisez des connexions avec les gens de votre quartier.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'hi', 'आवश्यक मुद्रा प्राप्त करते समय अन्य यात्रियों को मदद करें। अपने पड़ोस में लोगों के साथ संबंध बनाएं।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'ja', '必要な通貨を取得しながら他の旅行者を支援してください。あなたの近所の人々とのつながりを構築してください。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'pt', 'Ajude colegas viajantes enquanto obtém a moeda de que precisa. Crie conexões com pessoas em seu bairro.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'ru', 'Помогите другим путешественникам, получая необходимую вам валюту. Установите связи с людьми в вашем районе.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'sk', 'Pomôžte spoluputujúcim cestovateľom, keď získate potrebnú menu. Budujte spojenia s ľuďmi v komisáte.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('COMMUNITY_DESCRIPTION', 'zh', '在获得所需货币的同时帮助其他旅行者。与您所在社区的人建立联系。');
