REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'ar', 'تواصل مع المستخدمين الآخرين من خلال نظام المراسلة الآمن لدينا. ناقش أسعار الصرف والمبالغ وتفاصيل الاجتماع.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'de', 'Kontaktieren Sie andere Benutzer über unser sicheres Messaging-System. Diskutieren Sie Wechselkurse, Beträge und Treffpunktdetails.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'en', 'Contact other users through our secure messaging system. Discuss exchange rates, amounts, and meeting details.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'es', 'Contacta a otros usuarios a través de nuestro sistema de mensajería segura. Discute tasas de cambio, cantidades y detalles de encuentro.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'fr', 'Contactez d''autres utilisateurs via notre système de messagerie sécurisé. Discutez des taux de change, des montants et des détails de la réunion.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'hi', 'हमारी सुरक्षित मैसेजिंग सिस्टम के माध्यम से अन्य उपयोगकर्ताओं से संपर्क करें। विनिमय दरों, राशियों और मीटिंग विवरण पर चर्चा करें।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'ja', 'セキュアなメッセージング システムを通じて他のユーザーに連絡してください。為替レート、金額、会議の詳細について説明してください。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'pt', 'Entre em contato com outros usuários através do nosso sistema de mensagens seguro. Discuta taxas de câmbio, valores e detalhes de encontro.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'ru', 'Свяжитесь с другими пользователями через нашу защищенную систему обмена сообщениями. Обсудите курсы обмена, суммы и детали встречи.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'sk', 'Kontaktujte ďalších používateľov prostredníctvom nášho bezpečného systému zasielania správ. Diskutujte o výmenných kurzoch, sumách a podrobnostiach stretávania.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONNECT_DESCRIPTION', 'zh', '通过我们的安全消息传递系统与其他用户联系。讨论汇率、金额和会议详情。');
