REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_DESCRIPTION', 'sk', 'Jednorazový poplatok za odomknutie kontaktných informácií pre každý zoznam');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_DESCRIPTION', 'zh', '一次性费用以解锁每个列表的联系信息');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'ar', 'تساعد رسوم الاتصال البالغة 2.00 دولار على منع الرسائل غير المرغوب فيها وضمان التبادلات الجادة. بمجرد الدفع، يكون لديك رسائل غير محدودة مع هذا الشخص.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'de', 'Die Kontaktgebühr von 2,00 $ hilft, Spam zu verhindern und sicherzustellen, dass es sich um ernsthaften Austausch handelt. Nach Bezahlung haben Sie unbegrenzte Nachrichten mit dieser Person.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'en', 'The $2.00 contact fee helps prevent spam and ensures serious exchanges. Once paid, you have unlimited messaging with that person.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'es', 'La tarifa de contacto de $2.00 ayuda a prevenir spam y garantiza cambios serios. Una vez pagada, tiene mensajería ilimitada con esa persona.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'fr', 'Les frais de contact de 2,00 $ aident à prévenir le spam et assurent des échanges sérieux. Une fois payé, vous avez une messagerie illimitée avec cette personne.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'hi', '$2.00 संपर्क शुल्क स्पैम को रोकने और गंभीर विनिमय सुनिश्चित करने में मदद करता है। एक बार भुगतान करने के बाद, आपके पास उस व्यक्ति के साथ असीमित मैसेजिंग है।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'ja', '$2.00の連絡先料金はスパムを防止し、真摯な交換を保証します。支払い後、その人と無制限のメッセージングが可能になります。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'pt', 'A taxa de contato de $2.00 ajuda a prevenir spam e garante trocas sérias. Uma vez paga, você tem mensagens ilimitadas com essa pessoa.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'ru', 'Плата за контакт в размере 2,00 долл. США помогает предотвратить спам и обеспечить серьезный обмен. После оплаты у вас будет неограниченный обмен сообщениями с этим человеком.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'sk', 'Poplatok za kontakt 2,00 USD pomáha zabrániť spamu a zabezpečuje vážne výmeny. Po zaplatení máte neobmedzené posielanie správ s touto osobou.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CONTACT_FEE_EXPLANATION', 'zh', '$2.00的联系费用有助于防止垃圾邮件并确保认真的交易。一旦支付，您可以与该人进行无限制的消息传递。');
