REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CREATE_LISTING_DESCRIPTION', 'ar', 'انشر العملة التي لديك وما تريد تبديلها. اضبط موقعك وأماكن الاجتماع المفضلة.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CREATE_LISTING_DESCRIPTION', 'de', 'Veröffentlichen Sie die Währung, die Sie haben, und wofür Sie diese austauschen möchten. Legen Sie Ihren Standort und bevorzugte Treffpunkte fest.');
