REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CREATE_LISTING_DESCRIPTION', 'hi', 'वह मुद्रा पोस्ट करें जो आपके पास है और आप इसके लिए क्या विनिमय करना चाहते हैं। अपना स्थान और पसंदीदा मिलने की जगहें सेट करें।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CREATE_LISTING_DESCRIPTION', 'ja', 'あなたが持っている通貨と交換したいものを投稿してください。あなたの場所と好みの会議場所を設定してください。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('CREATE_LISTING_DESCRIPTION', 'pt', 'Poste a moeda que você tem e por que deseja trocá-la. Defina seu local e locais de encontro preferidos.');
