REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'ar', 'ابحث عن عمليات تبديل العملات التي تحدث بالقرب منك الآن. لا حاجة للذهاب إلى البنك أو الانتظار في الطابور في المطار.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'de', 'Finden Sie Währungsumtausche, die gerade in Ihrer Nähe stattfinden. Keine Notwendigkeit, zur Bank zu fahren oder am Flughafen Schlange zu stehen.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'en', 'Find currency exchanges happening near you right now. No need to drive to the bank or wait in line at the airport.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'es', 'Encuentra cambios de divisas sucediendo cerca de ti ahora mismo. No necesitas ir al banco ni esperar en la fila del aeropuerto.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'fr', 'Trouvez les échanges de devises qui se produisent près de vous maintenant. Pas besoin d''aller à la banque ou d''attendre à la queue de l''aéroport.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'hi', 'अभी आपके पास हो रहे मुद्रा विनिमय को खोजें। बैंक जाने या हवाई अड्डे पर कतार में प्रतीक्षा करने की आवश्यकता नहीं है।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'ja', '今あなたの近くで行われている通貨交換を見つけてください。銀行に行ったり、空港で列に並んだりする必要はありません。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'pt', 'Encontre trocas de moedas acontecendo perto de você agora. Não há necessidade de ir ao banco ou esperar na fila do aeroporto.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'ru', 'Найдите обмены валют, которые происходят рядом с вами прямо сейчас. Не нужно ехать в банк или ждать в очереди в аэропорту.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'sk', 'Nájdite výmeny mien, ktoré sa práve teraz dejú blízko vás. Nie je potrebné jazdiť do banky alebo čakať v rade na letisku.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('FAST_DESCRIPTION', 'zh', '找到现在在您附近发生的货币交换。无需驾驶到银行或在机场排队。');
