REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'de', 'Schließen Sie sich Tausenden von Reisenden an, die beim Währungsumtausch Geld sparen');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'en', 'Join thousands of travelers saving money on currency exchange');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'es', 'Únete a miles de viajeros ahorrando dinero en cambio de divisas');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'fr', 'Rejoignez des milliers de voyageurs économisant de l''argent sur l''échange de devises');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'hi', 'मुद्रा विनिमय पर पैसा बचाने वाले हजारों यात्रियों में शामिल हों');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'ja', '通貨交換でお金を節約する何千人もの旅行者に参加してください');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'pt', 'Junte-se a milhares de viajantes economizando dinheiro em troca de moedas');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'ru', 'Присоединитесь к тысячам путешественников, экономящих деньги при обмене валюты');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'sk', 'Присоединитесь к tisícom cestovateľom, ktorí ušetria peniaze na výmene meny');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_FOOTER', 'zh', '加入数千名旅行者，在货币兑换中节省资金');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'ar', 'تواصل مع جيرانك لتبديل العملات الأجنبية بأمان وبأسعار معقولة. تخطي الرسوم باهظة واحصل على الأموال التي تحتاجها من مجتمعك.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'de', 'Verbinden Sie sich mit Ihren Nachbarn, um Fremdwährungen sicher und preiswert auszutauschen. Sparen Sie sich die teuren Gebühren und holen Sie sich das Geld, das Sie benötigen, von Ihrer Gemeinde.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'en', 'Connect with neighbors to exchange foreign currency safely and affordably. Skip the expensive fees and get the cash you need from your community.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'es', 'Conecta con tus vecinos para cambiar moneda extranjera de forma segura y asequible. Salta las costosas comisiones y obtén el dinero que necesitas de tu comunidad.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'fr', 'Connectez-vous avec vos voisins pour échanger des devises étrangères en toute sécurité et à un coût abordable. Évitez les frais élevés et obtenez l''argent dont vous avez besoin auprès de votre communauté.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'hi', 'अपने पड़ोसियों के साथ जुड़ें ताकि विदेशी मुद्रा को सुरक्षित और सस्ते तरीके से विनिमय किया जा सके। महंगे शुल्क को छोड़ दें और अपने समुदाय से आवश्यक नकदी प्राप्त करें।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'ja', '隣人と連絡を取り合って、外国通貨を安全で手頃な価格で交換してください。高い手数料をスキップして、あなたのコミュニティから必要な現金を取得してください。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'pt', 'Conecte-se com seus vizinhos para trocar moeda estrangeira com segurança e acessibilidade. Pule as taxas caras e obtenha o dinheiro que você precisa da sua comunidade.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'ru', 'Свяжитесь со своими соседями, чтобы обменять иностранную валюту безопасно и доступно. Пропустите дорогие комиссии и получите нужные вам деньги из вашего сообщества.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'sk', 'Spojte sa so svojimi susedmi na bezpečnú a dostupnú výmenu cudzích mien. Preskočte drahé poplatky a získajte peniaze, ktoré potrebujete od svojej komunity.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('LANDING_PAGE_DESCRIPTION', 'zh', '与您的邻居联系以安全且经济实惠的方式交换外币。跳过昂贵的费用，从您的社区获取所需的现金。');
