REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'ar', 'التقِ في مكان عام آمن مثل مقهى أو بهو البنك. تبادل عملتك وجهاً لوجه.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'de', 'Treffen Sie sich an einem sicheren, öffentlichen Ort wie einem Café oder einer Banklobby. Tauschen Sie Ihre Währung persönlich aus.');
