REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'es', 'Reúnete en un lugar público seguro como una cafetería o el vestíbulo de un banco. Cambia tu moneda cara a cara.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'fr', 'Rencontrez-vous dans un lieu public sûr comme un café ou le hall d''une banque. Échangez votre devise en personne.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'hi', 'कैफे या बैंक लॉबी जैसी सुरक्षित सार्वजनिक जगह पर मिलें। आमने-सामने अपनी मुद्रा का आदान-प्रदान करें।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'ja', 'カフェやバンクロビーなどの安全な公共の場所で会いましょう。あなたの通貨を直接交換してください。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'pt', 'Encontre-se em um local público seguro, como uma cafeteria ou saguão de um banco. Troque sua moeda pessoalmente.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'ru', 'Встречайтесь в безопасном общественном месте, таком как кофейня или вестибюль банка. Обменяйте вашу валюту лично.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'sk', 'Stretnite sa na bezpečnom verejnom mieste, ako je kaviareň alebo hala banky. Vymeňte si menu tvárou v tvár.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_DESCRIPTION', 'zh', '在咖啡馆或银行大厅等安全的公共场所见面。面对面交换您的货币。');
