REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_PUBLIC_PLACES', 'es', 'Siempre reúnete en lugares públicos bien iluminados como cafeterías, vestíbulos de bancos o centros comerciales');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('MEET_PUBLIC_PLACES', 'fr', 'Rencontrez-vous toujours dans des lieux publics bien éclairés comme des cafés, des halls de banque ou des centres commerciaux');
