REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'ar', 'Nice Traders هي منصة نظير إلى نظير تربط المسافرين والسكان المحليين الذين يريدون تبديل العملات الأجنبية. بدلاً من دفع رسوم عالية في البنوك أو أكشاك الصرف، يمكنك العثور على شخص في حيك يمتلك العملة التي تحتاجها ويريد ما لديك.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'de', 'Nice Traders ist eine Peer-to-Peer-Plattform, die Reisende und Einheimische verbindet, die Fremdwährungen austauschen möchten. Anstatt hohe Gebühren in Banken oder Wechselstuben zu zahlen, können Sie jemanden in Ihrer Nachbarschaft finden, der die Währung hat, die Sie benötigen, und möchte, was Sie haben.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'en', 'Nice Traders is a peer-to-peer platform that connects travelers and locals who want to exchange foreign currency. Instead of paying high fees at banks or exchange kiosks, you can find someone in your neighborhood who has the currency you need and wants what you have.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'es', 'Nice Traders es una plataforma entre pares que conecta a viajeros y locales que desean cambiar moneda extranjera. En lugar de pagar altas comisiones en bancos o casas de cambio, puede encontrar a alguien en su vecindario que tenga la moneda que necesita y desee lo que usted tiene.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'fr', 'Nice Traders est une plateforme pair-à-pair qui connecte les voyageurs et les locaux qui souhaitent échanger des devises étrangères. Au lieu de payer des frais élevés dans les banques ou les bureaux de change, vous pouvez trouver quelqu''un dans votre quartier qui a la devise dont vous avez besoin et veut ce que vous avez.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'hi', 'Nice Traders एक पीयर-टू-पीयर प्लेटफॉर्म है जो यात्रियों और स्थानीय लोगों को जोड़ता है जो विदेशी मुद्रा का आदान-प्रदान करना चाहते हैं। बैंकों या विनिमय कियोस्क में उच्च शुल्क का भुगतान करने के बजाय, आप अपने पड़ोस में किसी को ढूंढ सकते हैं जिसके पास आपको आवश्यक मुद्रा है और जो आपके पास है उसे चाहता है।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'ja', 'Nice Tradersは、外国通貨を交換したい旅行者と地元の人々を結ぶピアツーピアプラットフォームです。銀行や両替所で高い手数料を支払う代わりに、近所で必要な通貨を持ち、あなたが持っているものを欲しい誰かを見つけることができます。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'pt', 'Nice Traders é uma plataforma peer-to-peer que conecta viajantes e locais que desejam trocar moeda estrangeira. Em vez de pagar altas taxas em bancos ou casas de câmbio, você pode encontrar alguém em seu bairro que tenha a moeda que você precisa e queira o que você tem.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'ru', 'Nice Traders - это платформа P2P, которая соединяет путешественников и местных жителей, которые хотят обменять иностранную валюту. Вместо того чтобы платить высокие комиссии в банках или пунктах обмена, вы можете найти в своем районе человека, у которого есть нужная вам валюта и который хочет то, что у вас есть.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'sk', 'Nice Traders je platforma peer-to-peer, ktorá spája cestovateľov a miestnych, ktorí chcú vymeniť cudzí menový. Namiesto platenia vysokých poplatkov v bankách alebo zmenárnach môžete nájsť v svojom okolí niekoho, kto má menu, ktorú potrebujete, a chce to, čo máte.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('NICE_TRADERS_DESCRIPTION', 'zh', 'Nice Traders是一个点对点平台，连接想要交换外币的旅客和本地人。与其在银行或兑换亭支付高额费用，不如在您的社区中找到拥有您需要的货币并想要您拥有的东西的人。');
