REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'ar', 'عرض تقييمات المستخدمين والالتقاء في الأماكن العامة والتواصل عبر منصتنا الآمنة. السلامة هي أولويتنا.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'de', 'Sehen Sie sich Benutzerbewertungen an, treffen Sie sich an öffentlichen Orten und kommunizieren Sie über unsere sichere Plattform. Sicherheit ist unsere Priorität.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'en', 'View user ratings, meet in public places, and communicate through our secure platform. Safety is our priority.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'es', 'Ver calificaciones de usuarios, encontrarse en lugares públicos y comunicarse a través de nuestra plataforma segura. La seguridad es nuestra prioridad.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'fr', 'Consultez les évaluations des utilisateurs, rencontrez-vous dans des lieux publics et communiquez via notre plateforme sécurisée. La sécurité est notre priorité.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'hi', 'उपयोगकर्ता रेटिंग देखें, सार्वजनिक स्थानों पर मिलें, और हमारे सुरक्षित प्लेटफॉर्म के माध्यम से संवाद करें। सुरक्षा हमारी प्राथमिकता है।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'ja', 'ユーザー評価を表示し、公共の場所で会い、当社のセキュアなプラットフォームで通信します。安全は私たちの優先事項です。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'pt', 'Visualize classificações de usuários, reúna-se em locais públicos e comunique-se através de nossa plataforma segura. A segurança é nossa prioridade.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'ru', 'Просмотрите рейтинги пользователей, встречайтесь в общественных местах и общайтесь через нашу безопасную платформу. Безопасность - наш приоритет.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'sk', 'Zobraziť hodnotenia používateľov, stretnúť sa na verejných miestach a komunikovať prostredníctvom našej bezpečnej platformy. Bezpečnosť je naša priorita.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAFE_DESCRIPTION', 'zh', '查看用户评分，在公共场所见面，通过我们的安全平台进行通信。安全是我们的优先事项。');
