REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'ar', 'تفرض البنوك وأكشاك المطارات رسوم وزيادات بنسبة 5-15٪. مع Nice Traders، تفاوض على أسعار تعمل لكلا الطرفين.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'de', 'Banken und Flughafenkioske berechnen 5-15% an Gebühren und Aufschlägen. Mit Nice Traders verhandeln Sie Tarife, die für beide Seiten funktionieren.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'en', 'Banks and airport kiosks charge 5-15% in fees and markups. With Nice Traders, negotiate rates that work for both parties.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'es', 'Los bancos y los quioscos del aeropuerto cobran comisiones y recargos del 5-15%. Con Nice Traders, negocia tasas que funcionen para ambas partes.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'fr', 'Les banques et les kiosques aéroportuaires facturent des frais et des majorations de 5 à 15%. Avec Nice Traders, négociez des tarifs qui conviennent aux deux parties.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'hi', 'बैंक और हवाई अड्डे की कियोस्क 5-15% शुल्क और मार्कअप लेते हैं। Nice Traders के साथ, उन दरों पर बातचीत करें जो दोनों पक्षों के लिए काम करती हैं।');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'ja', '銀行と空港のキオスクは手数料とマークアップで5～15％を請求します。Nice Tradersでは、両当事者に対応する料金を交渉してください。');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'pt', 'Bancos e quiosques de aeroporto cobram taxas de 5-15% e margens. Com Nice Traders, negocie taxas que funcionem para ambas as partes.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'ru', 'Банки и аэропортовые киоски берут комиссионные и наценки в размере 5-15%. С Nice Traders вы можете договориться о ставках, которые будут работать для обеих сторон.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'sk', 'Banky a letiskové kinosky si účtujú poplatky a prirážky 5-15%. S Nice Traders vyjednajte sadzby, ktoré budú fungovať pre obe strany.');
REPLACE INTO translations (translation_key, language_code, translation_value) VALUES ('SAVE_MONEY_DESCRIPTION', 'zh', '银行和机场亭收取5-15%的费用和加价。使用Nice Traders，协商对双方都有效的费率。');
